



VALUES (3, 'The Mandalorian', 'Ambientada tras la caída del Imperio y antes de la aparición de la Primera Orden, la Serie sigue los pasos de un pistolero solitario en las aventuras que protagoniza en los confines de la galaxia, donde no alcanza la autoridad de la Nueva República.', './posters/3.jpg', 'Ciencia Ficción', 2, '', 'The Mandalorian, Sci-Fi, Fantasía, Suspenso, Pedro Pascal, Carl Weathers, Misty Rosas, Chris Bartlett, Rio Hackford, Giancarlo Esposito', 'https://www.youtube.com/embed/aOC8E8z_ifw', 1);
VALUES (4, 'The Umbrella Academy', 'La muerte de su padre reúne a unos hermanos distanciados y con extraordinarios poderes que descubren impactantes secretos y una amenaza que se cierne sobre la humanidad.', './posters/4.jpg', 'Ciencia Ficción', 1, '', 'The Umbrella Academy, Sci-Fi, Fantasía, Drama, Tom Hopper, David Castañeda, Emmy Raver-Lampman, Robert Sheehan, Aidan Gallagher, Elliot Page', 'https://www.youtube.com/embed/KHucKOK-Vik', 1);
VALUES (5, 'Gambito de Dama', 'En los cincuenta, una joven de un orfanato descubre que tiene un increíble don para el ajedrez y recorre el arduo camino a la fama mientras lucha contra las adicciones.', './posters/5.jpg', 'Drama', 1, '', 'Gambito de Dama, Drama, Ficción, Sucesos, Anya Taylor-Joy, Thomas Brodie-Sangster, Harry Melling, Moses Ingram, Chloe Pirrie, Janina Elkin', 'https://www.youtube.com/embed/lbleRbyGKL4', 1);
VALUES (2, 'Riverdale', 'El paso a la edad adulta incluye sexo, romance, escuela y familia. Para Archie y sus amigos, también hay misterios oscuros.', './posters/2.jpg', 'Drama', 5, '', 'Riverdale, Drama, Misterio, Ficción, Lili Reinhart, Casey Cott, Camila Mendes, Marisol Nichols, Madelaine Petsch, Mädchen Amick', 'https://www.youtube.com/embed/HxtLlByaYTc', 1);
VALUES (1, 'The Crown', 'Este drama narra las rivalidades políticas y el romance de la reina Isabel II, así como los sucesos que moldearon la segunda mitad del siglo XX.', './posters/1.jpg', 'Suceso Real', 4, '', 'The Crown, Drama, Suceso Real, Claire Fox, Olivia Colman, Matt Smith, Tobias Menzies, Vanesa Kirby, Helena Bonham Carter', 'https://www.youtube.com/embed/JWtnJjn6ng0', 1);
VALUES (6, 'Enola Holmes', 'La hermana menor de Sherlock, descubre que su madre ha desaparecido y se dispone a encontrarla. En su búsqueda, saca a relucir el sabueso que corre por sus venas y se encuentra con una conspiración que gira en torno a un misterioso lord, demostrando que su ilustre hermano no es el único talento en la familia.', './posters/6.jpg', 'Drama', NULL, '97 minutos', 'Enola Holmes, Ficción, Drama, Misterio, Millie Bobby Brown, Henry Cavill, Sam Claflin, Helena Bonham Carter, Louis Partridge, Adeel Akhtar', 'https://www.youtube.com/embed/3t1g2pa355k', 2);
VALUES (7, 'Guasón', 'Arthur Fleck (Phoenix) es un hombre ignorado por la sociedad, cuya motivación en la vida es hacer reír. Pero una Serie de trágicos acontecimientos le llevarán a ver el mundo de otra forma. Película basada en el popular personaje de DC Comics Joker, conocido como archivillano de Batman, pero que en este film tomará un cariz más realista y oscuro.', './posters/7.jpg', 'Suspenso', NULL, '97 minutos', 'Guasón, The Joker, Crimen, Suspenso, Drama, DC Comics, Joaquin Phoenix, Robert De Niro, Zazie Beetz, Frances Conroy, Brett Cullen, Shea Whigham', 'https://www.youtube.com/embed/zAGVQLHvwOY', 2);
VALUES (8, 'Avengers: End Game', 'Después de los devastadores eventos de los Vengadores: Infinity War (2018), el universo está en ruinas. Con la ayuda de los aliados restantes, los Vengadores se reúnen una vez más para revertir las acciones de Thanos y restaurar el equilibrio del universo.', './posters/8.jpg', 'Ciencia Ficción', NULL, '97 minutos', 'Vengadores, Los vengadores, Marvel, The Avengers: End Game, Aventura, Sci-Fi, Acción, Robert Downey Jr., Chris Evans, Mark Ruffalo, Chris Hemsworth, Scarlett Johansson, Jeremy Renner', 'https://www.youtube.com/embed/TcMBFSGVi1c', 2);
VALUES (9, 'Juego de tronos', 'En un mundo fantástico y en un contexto medieval varias familias, relativas a la nobleza, se disputan el poder para dominar el territorio ficticio de Poniente (Westeros) y tomar el control de los Siete Reinos desde el Trono de Hierro, lugar donde el rey ejerce el poder.', './posters/9.jpg', 'Fantasía', 8, '', 'Juego de tronos, Game of Thrones, Aventura, Fantasía, Drama, Emilia Clarke, Lena Headey, Sophie Turner, Kit Harington, Peter Dinklage, Nikolaj Coster-Waldau', 'https://www.youtube.com/embed/KPLWWIOCOOQ', 1);
VALUES (10, 'The Flash', 'Sigue las veloces aventuras de Barry Allen, un joven común y corriente con el deseo latente de ayudar a los demás. Cuando una inesperada partícula aceleradora golpea por accidente a Barry, de pronto se encuentra cargado de un increíble poder para moverse a increíbles velocidades. Mientras Barry siempre ha tenido el alma de un héroe, sus nuevos poderes le han dado la capacidad de actuar como tal.', './posters/10.jpg', 'Ciencia Ficción', 6, '', 'The Flash, DC Comics, Sci-Fi, Fantasía, Acción, Grant Gustin, Carlos Valdes, Danielle Panabaker, Candice Patton, Jesse L. Martin, Tom Cavanagh', 'https://www.youtube.com/embed/Yj0l7iGKh8g', 1);
VALUES (11, 'The Big Bang Theory', 'Leonard y Sheldon son dos físicos que comparten trabajo y apartamento. La Serie comienza con la mudanza de Penny, su nueva y atractiva vecina, y hace hincapié en la dificultad de los físicos para relacionarse con personas fuera de su entorno para dar lugar a situaciones cómicas.', './posters/11.jpg', 'Comedia', 12, '', 'The Big Bang Theory, La teoría del Big Bang, Comedia, Fantasía, Ficción, Jim Parsons, Johnny Galecki, Kaley Cuoco, Simon Helberg, Kunal Nayyar, Melissa Rauch, Mayim Bialik', 'https://www.youtube.com/embed/WBb3fojgW0Q', 1);
VALUES (12, 'Friends', '''Friends'' narra las aventuras y desventuras de seis jóvenes de Nueva York: Rachel, Monica, Phoebe, Ross, Chandler y Joey. Ellos forman una unida pandilla de amigos que viven en Manhattan y que suelen reunirse en sus apartamentos o en su bar habitual cafetería, el Central Perk. A pesar de los numerosos cambios que se producen en sus vidas, su amistad es inquebrantable en la dura batalla por salir adelante en sus periplos profesionales y personales.', './posters/12.jpg', 'Comedia', 10, '', 'Friends, Amigos, Comedia, Familia, Drama, Sitcom, Jennifer Aniston, Courteney Cox, Lisa Kudrow, David Schwimmer, Matthew Perry, Matt LeBlanc', 'https://www.youtube.com/embed/ekYGfU0XIx0', 1);
VALUES (13, 'Anne with an ''E''', 'Anne Shirley es una niña huérfana que vive en un pequeño pueblo llamado Avonlea que pertenece a la Isla del Príncipe Eduardo, en el año 1890. Después de una infancia difícil, donde fue pasando de orfanato a hogares de acogida, es enviada por error a vivir con una solterona y su hermano. Cuando cumple 13 años, Anne va a conseguir transformar su vida y el pequeño pueblo donde vive gracias a su fuerte personalidad, intelecto e imaginación. Basada en la inolvidable novela.', './posters/13.jpg', 'Familia', 2, '', 'Anne with an ''E'', Drama, Familia, Western, Amybeth McNulty, Geraldine James, R. H. Thomson, Corrine Koslo, Dalila Bela, Lucas Jade Zumann', 'https://www.youtube.com/embed/M4T-_aB8smU', 1);
VALUES (14, 'Expedientes Secretos ''X''', 'Fox Mulder y Dana Scully son dos investigadores del FBI que investigan casos sin resolución ni explicación, ya sea por razones paranormales (espíritus, criaturas extrañas, aliens...) ya porque el gobierno se ha encargado de ocultar todo tipo de pruebas. Cuando Mulder tenía doce años, su hermana pequeña fue secuestrada por unos desconocidos, aunque él cree que, en realidad, fue abducida por extraterrestres. Tras acabar sus estudios en la universidad de Oxford, ingresó en la Academia de Quantico, donde se ganó el apodo de ''siniestro''', './posters/14.jpg', 'Ciencia Ficción', 11, '', 'Expedientes Secretos ''X'', The X Files, Expedientes X, Drama, Sci-Fi, Suspenso, Gillian Anderson, David Duchovny, Mitch Pileggi, Robert Patrick, Tom Braidwood, Bruce Harwood', 'https://www.youtube.com/embed/KKziOmsJxzE', 1);
VALUES (15, 'Chernobyl', 'Sigue «la verdadera historia de una de las peores catástrofes provocadas por el hombre y habla de los valientes hombres y mujeres que se sacrificaron para salvar a Europa de un desastre inimaginable. La miniSerie se centra en el desgarrador alcance del desastre de la planta nuclear que ocurrió en Ucrania en abril de 1986, revelando cómo y por qué ocurrió, además contando las sorprendentes y notables historias de los héroes que lucharon y cayeron.', './posters/15.jpg', 'Suceso Real', 1, '', 'Chernobyl, Drama, Suceso Real, Jared Harris, Stellan Skarsgård, Emily Watson, Paul Ritter, Jessie Buckley, Adam Nagaitis', 'https://www.youtube.com/embed/s9APLXM9Ei8', 1);
VALUES (16, 'Westworld', '''Westworld'' es una oscura odisea acerca del amanecer de la conciencia artificial y la evolución del pecado. Situada en la intersección del futuro cercano y el pasado reimaginado, explora un mundo donde cada apetito humano, sin importar cuán noble o depravado, puede ser saciado. Está ambientada en un parque temático futurista dirigido por el Dr. Robert Ford (Anthony Hopkins). Las instalaciones cuentan con androides caracterizados del western americano, y gracias a ellos los visitantes pueden introducirse en cualquier tipo de fantasía por muy oscura que sea.', './posters/16.jpg', 'Ciencia Ficción', 3, '', 'Westworld, Western, Sci-Fi, Drama, Evan Rachel Wood, Thandiwe Newton, Jeffrey Wright, Tessa Thompson, Ed Harris, Luke Hemsworth, Rodrigo Santoro, Simon Quarterman, Clifton Collins Jr., Anthony Hopkins, Ingrid Bolsø Berdal, Angela Sarafyan, Shannon Woodward, Talulah Riley, Louis Herthum, Ben Barnes, Jimmi Simpson, Leonardo Nam, Aaron Paul, Vincent Cassel, Izabella Alvarez, Jeff Daniel Phillips', 'https://www.youtube.com/embed/qLFBcdd6Qw0', 1);
VALUES (17, 'Halt and Catch Fire', 'Situada en los inicios de la década de 1980, un visionario ficticio, un ingeniero electrónico y una prodigiosa ingeniera, se alían a una programadora de software para confrontar con las corporaciones informáticas dominantes de la época. El Personal de la firma y sus socios de negocio, comenzarán una carrera que cambiará la cultura en el Estado de Texas, cuna de las empresas de tecnología, casi de la misma forma que lo es hoy Silicon Valey. 
 Esta historia ficticia emula el trabajo realizado, en su momento, por la firma Compaq, cuando clonó el BIOS de las Computadoras Personales IBM, dando vida así al económico mercado de los clones. Mostrando también, a lo largo de sus 4 temporadas, el nacimiento de la arquitectura abierta de hardware, los videojuegos online, las salas de chat y de trueque de productos físicos, los BBS, y las primeras nubes computacionales, hasta la llegada de Internet (sin dejar afuera la guerra de los web browsers).', './posters/17.jpg', 'Drama', 4, '', 'Halt and Catch Fire, Ficción, Drama, Tecnología, Lee Pace, Scoot McNairy, Mackenzie Davis, Kerry Bishé, Toby Huss, Alana Cavanaugh', 'https://www.youtube.com/embed/pWrioRji60A', 1);
VALUES (18, 'Ava', 'Ava es una mortífera asesina a sueldo que trabaja para una organización de operaciones encubiertas, que viaja por todo el mundo acabando con aquellos objetivos que nadie más puede derribar. Cuando uno de sus encargos sale mal, Ava tendrá que luchar por una vida.', './posters/18.jpg', 'Acción', NULL, '97 minutos', 'Ava, Acción, Drama, Suspenso, Jessica Chastain, John Malkovich, Colin Farrell, Common, Geena Davis, Ioan Gruffudd', 'https://www.youtube.com/embed/eLEwNo78f0k', 2);
VALUES (19, 'Aves de presa (Harley Quinn)', 'Después de separarse de Joker, Harley Quinn y otras tres heroínas (Canario Negro, Cazadora y Renée Montoya) unen sus fuerzas para salvar a una niña (Cassandra Cain) del malvado rey del crimen Máscara Negra.', './posters/19.jpg', 'Ciencia Ficción', NULL, '97 minutos', 'Aves de presa y la fantabulosa emancipación de una Harley Quinn, Acción, Ficción, Comedia, DC Comics, Margot Robbie, Ewan McGregor, Mary Elizabeth Winstead, Jurnee Smollett, Rosie Perez, Chris Messina', 'https://www.youtube.com/embed/saUmnenKbBM', 2);
VALUES (20, 'Archivo', '2038: George Almore está trabajando en una verdadera IA equivalente a la humana. Su último prototipo está casi listo. Esta fase sensible también es la más arriesgada. Especialmente porque tiene un objetivo que debe ocultarse a toda costa: reunirse con su esposa muerta.', './posters/20.jpg', 'Ciencia Ficción', NULL, '97 minutos', 'Archivo, File, Acción, Sci-Fi, Suspenso, Stacy Martin, Rhona Mitra, Theo James, Peter Ferdinando, Lia Williams, Toby Jones', 'https://www.youtube.com/embed/VHSoCnDioAo', 2);
VALUES (22, '3022', 'La película está ambientada en una estación espacial en el futuro. La tripulación sufre un estrés traumático y considera abandonar su misión después de observar lo que creen que es la destrucción de la Tierra. La película se muestra como una Serie de flashbacks y flash-forward.', './posters/22.jpg', 'Suspenso', NULL, '97 minutos', '3022, Sci-Fi, Suspenso, Futurista, Miranda Cosgrove, Kate Walsh, Omar Epps, Angus Macfadyen, Jorja Fox, Enver Gjokaj', 'https://www.youtube.com/embed/AGQ7OkmIx4Q', 2);
VALUES (23, 'IT - Capítulo 2', 'En este segundo capitulo Han pasado 27 años desde que el ''Club de los Perdedores'', formado por Bill, Berverly, Richie, Ben, Eddie, Mike y Stanley, se enfrentaran al macabro y despiadado Pennywise (Bill Skarsgård). En cuanto tuvieron oportunidad, abandonaron el pueblo de Derry, en el estado de Maine, que tantos problemas les había ocasionado. Sin embargo, ahora, siendo adultos, parece que no pueden escapar de su pasado. Todos deberán enfrentarse de nuevo al temible payaso para descubrir si de verdad están preparados para superar sus traumas de la infancia.', './posters/23.jpg', 'Terror', NULL, '97 minutos', 'IT - Capítulo 2, Chapter 2, Chapter Two, Penniwise, Terror, Suspenso, Fantasía, Bill Skarsgård, Jessica Chastain, Bill Hader, James McAvoy, Isaiah Mustafa, Jay Ryan', 'https://www.youtube.com/embed/hZeFeYSmBcg', 2);
VALUES (24, 'Pantera Negra', 'T’Challa (Chadwick Boseman) regresa a su hogar en la apartada nación africana de Wakanda para servir como líder de su país. Tras suceder a su padre en el trono, pasa a convertirse en Pantera Negra, una sigilosa criatura de la noche, con agudos sentidos felinos y otras habilidades como súper fuerza e inteligencia, agilidad, estrategia o maestro del combate sin armas. Es bajo el liderazgo de T’Challa como Wakanda consigue convertirse en una de las naciones más ricas y tecnológicamente avanzadas del planeta.', './posters/24.jpg', 'Ciencia Ficción', NULL, '97 minutos', 'Pantera Negra, Black Panther, Acción, Aventura, Fantasía, Marvel, Chadwick Boseman, Michael B. Jordan, Lupita Nyong''o, Danai Gurira, Martin Freeman, Daniel Kaluuya', 'https://www.youtube.com/embed/BE6inv8Xh4A', 2);
VALUES (25, 'Contra lo imposible (Ford versus Ferrari)', 'Los ganadores del Premio de la Academia® Matt Damon y Christian Bale protagonizan CONTRA LO IMPOSIBLE, basada en la historia real del visionario diseñador americano de automóviles Carroll Shelby (Damon) y el intrépido piloto británico Ken Miles (Bale). Juntos construyen un nuevo coche de carreras para Ford Motor Company y así enfrentar a Enzo Ferrari en las 24 Horas de Le Mans en Francia en 1966.', './posters/25.jpg', 'Suceso Real', NULL, '97 minutos', 'Contra lo imposible (Ford versus Ferrari), Drama, Historia, Aventura, Christian Bale, Matt Damon, Caitriona Balfe, Josh Lucas, Noah Jupe, Jon Bernthal', 'https://www.youtube.com/embed/SOVb0-2g1Q0', 2);
VALUES (26, 'Centígrados', 'Una joven pareja estadounidense viaja a las montañas árticas de Noruega. Después de detenerse durante una tormenta de nieve, se despiertan atrapados en su SUV, enterrados bajo capas de nieve y hielo.', './posters/26.jpg', 'Suspenso', NULL, '97 minutos', 'Centígrados, Centigrades, Drama, Suspenso, Intriga, Génesis Rodríguez, Vincent Piazza, Benjamin Sokolow, Emily Bayiokos', 'https://www.youtube.com/embed/0RvV7TNUlkQ', 2);
VALUES (27, 'DOOM: Aniquilación', 'Doom: Aniquilación sigue a un grupo de marines espaciales que han respondido a una llamada de alerta de una base en la luna marciana, solo para descubrir que ha sido tomada por criaturas demoníacas que amenazan con desatar el infierno en la tierra.', './posters/27.jpg', 'Terror', NULL, '97 minutos', 'DOOM: Aniquilación, Anihilation, Las puertas del infierno, Terror, Acción, Sci-Fi, Futurista, Amy Manson, Luke Allen-Gale, Nina Bergman, Dominic Mafham, James Weber Brown, Lorina Kamburova', 'https://www.youtube.com/embed/nat3u3gAVLE', 2);
VALUES (28, 'Contagio', 'De repente, sin saber cuál es su origen, aunque todo hace sospechar que comienza con el viaje de una norteamericana a un casino de Hong Kong, un virus mortal comienza a propagarse por todo el mundo. En pocos días, la enfermedad empieza a diezmar a la población. El contagio se produce por mero contacto entre los seres humanos. Un thriller realista y sin efectos especiales sobre los efectos de una epidemia.', './posters/28.jpg', 'Drama', NULL, '97 minutos', 'Contagio, Contagion, Covid, Drama, Suspenso, ¿Ficción?, Marion Cotillard, Matt Damon, Laurence Fishburne, Jude Law, Kate Winslet, Jennifer Ehle, Gwyneth Paltrow', 'https://www.youtube.com/embed/4sYSyuuLk5g', 2);
VALUES (29, 'Viuda Negra', 'Primera pelicula individual de la Viuda Negra en el universo cinematografico de Marvel, contando su historia desde que se inició como doble agente rusa, su niñez, sus misiones, y su actualidad, después de Avengers.', './posters/29.jpg', 'Acción', NULL, '97 minutos', 'Viuda Negra, Black Widow, Marvel, Drama, Acción, Aventura, Scarlett Johansson, Florence Pugh, David Harbour, O.T. Fagbenle, Rachel Weisz, William Hurt, Ray Winstone', 'https://www.youtube.com/embed/BIn8iANwEog', 2);
VALUES (30, 'The Martian', 'Durante una misión a Marte de la nave tripulada Ares III, una fuerte tormenta se desata dando por desaparecido y muerto al astronauta Mark Watney (Matt Damon), sus compañeros toman la decisión de irse pero él ha sobrevivido. Está solo y sin apenas recursos en el planeta. Con muy pocos medios deberá recurrir a sus conocimientos, su sentido del humor y un gran instinto de supervivencia para lograr sobrevivir y comunicar a la Tierra que todavía está vivo esperando que acudan en su rescate.', './posters/30.jpg', 'Ciencia Ficción', NULL, '97 minutos', 'The Martian, Rescate en Marte, Planeta Marte, El Marciano, Drama, Sci-Fi, Aventura, Espacio, Matt Damon, Jessica Chastain, Kristen Wiig, Jeff Daniels, Michael Peña, Sean Bean, Kate Mara', 'https://www.youtube.com/embed/XvB58bCVfng', 2);
VALUES (31, 'Ex-Machina', 'Un programador multimillonario selecciona a Caleb, un joven empleado de su empresa, para que pase una semana en un lugar remoto con el objetivo de que participe en un test en el que estará involucrada su última creación: un robot-mujer en el que inteligencia artificial lo es todo.', './posters/31.jpg', 'Ciencia Ficción', NULL, '97 minutos', 'Ex-Machina, Ex-Máquina, Ex-Maquina, Drama, Sci-Fi, Suspenso, Alicia Vikander, Domhnall Gleeson, Oscar Isaac, Sonoya Mizuno, Corey Johnson, Claire Selby, Gana Bayarsaikhan, Inteligencia Artificial, AI, IA', 'https://www.youtube.com/embed/XRYL5spvEcI', 2);
VALUES (32, 'Jurassic World', 'Veintidós años después de lo ocurrido en Jurassic Park, la isla Nublar ha sido transformada en un enorme parque temático, Jurassic Wold, con versiones «domesticadas» de algunos de los dinosaurios más conocidos. Cuando todo parece ir sobre ruedas y ser el negocio del siglo, un nuevo dinosaurio de especie desconocida, pues ha sido creado manipulando genéticamente su ADN, y que resulta ser mucho más inteligente de lo que se pensaba, se escapa de su recinto y comienza a causar estragos entre los visitantes del Parque.', './posters/32.jpg', 'Aventura', NULL, '97 minutos', 'Jurassic World, Mundo Jurásico, Jurassic Park, Suspenso, Aventura, Ficción, Bryce Dallas Howard, Chris Pratt, Irrfan Khan, Vincent D''Onofrio, Omar Sy, Nick Robinson, Judy Greer', 'https://www.youtube.com/embed/RFinNxS5KN4', 2);
VALUES (33, 'Soy leyenda', 'Años después de que una plaga mate a la mayoría de la humanidad y transforme al resto en monstruos, el único superviviente en la ciudad de Nueva York lucha valientemente para encontrar una cura.', './posters/33.jpg', 'Terror', NULL, '97 minutos', 'Soy leyenda, I am a legend, Drama, Terror, Ficción, Zombi, Zombies, Will Smith, Alice Braga, Charlie Tahan, Dash Mihok, Salli Richardson-Whitfield, Willow Smith, Emma Thompson', 'https://www.youtube.com/embed/dtKMEAXyPkg', 2);
VALUES (34, 'El primer hombre en la luna', 'Cuenta la historia de la misión de la NASA que llevó al primer hombre a la luna, centrada en Neil Armstrong (interpretado por Ryan Gosling) y el periodo comprendido entre los años 1961 y 1969. Un relato en primera persona, basado en la novela de James R. Hansen, que explora el sacrificio y el precio que representó, tanto para Armstrong como para Estados Unidos, una de las misiones más peligrosas de la historia.', './posters/34.jpg', 'Suceso Real', NULL, '97 minutos', 'El primer hombre en la luna, The first man, The moon, Drama, Suceso Real, Neil Armstrong, Ryan Gosling, Claire Foy, Jason Clarke, Kyle Chandler, Corey Stoll, Patrick Fugit, Drama, Suceso Real', 'https://www.youtube.com/embed/PSoRx87OO6k', 2);
VALUES (35, 'Titanes del pacífico - La insurrección', 'Han pasado 10 años tras la primera invasión que sufrió la humanidad, pero la lucha aún no ha terminado. El planeta vuelve a ser asediado por los Kaiju, una raza de alienígenas colosales, que emergen desde un portal interdimensional con el objetivo de destruir a la raza humana. Ante esta nueva amenaza, los Jaegers, robots gigantes de guerra pilotados por dos personas para sobrellevar la inmensa carga neuronal que conlleva manipularlos, ya no están a la altura de lo que se les viene encima. Será entonces cuando los supervivientes de la primera invasión, además de nuevos personajes como el hijo de Pentecost, tendrán que idear la manera de sorprender al enorme enemigo, apostando por nuevas estrategias defensivas y de ataque. Con la Tierra en ruinas e intentando reconstruirse, esta nueva batalla puede ser decisiva para el futuro.', './posters/35.jpg', 'Ciencia Ficción', NULL, '97 minutos', 'Titanes del pacífico - La insurrección, Pacific RIM, Rim, Acción, Fantasía, Sci-Fi, John Boyega, Scott Eastwood, Cailee Spaeny, Jing Tian, Rinko Kikuchi, Burn Gorman', 'https://www.youtube.com/embed/_EhiLLOhVis', 2);
VALUES (36, 'JOBS: La Vida De Steve Jobs', 'Sólo hace falta una persona para empezar una revolución. Jobs es la extraordinaria historia de Steve Jobs, el original innovador y emprendedor que no dejó que nada se interpusiera en su camino hacia la grandeza. La película cuenta la épica y turbulenta historia de Jobs mientras abría un camino que cambió la tecnología - y el mundo - para siempre. Su vida es repasada desde que era adolescente, intentando estudiar en la universidad, hasta el año 2001, cuando el iPod fue presentado al mundo y comenzó a ''allanar'' el camino para lo que años después, sería el iPhone.', './posters/36.jpg', 'Suceso Real', NULL, '104 minutos', 'JOBS: La Vida De Steve Jobs, Drama, Historia, Biopic, Suceso Real, Ahston Kutcher, Dermot Mulroney, Josh Gad, Lukas Haas, Matthew Modine, J.K. Simmons, Lesley Ann Warren, Apple, Cupertino', 'https://www.youtube.com/embed/FrvkCS0ZGPU', 2);
VALUES (37, 'Piratas de Silicon Valey', 'Esta película es el documental semigracioso sobre los hombres que hicieron el mundo de la tecnología lo que es hoy, sus luchas durante el colegio, la fundación de sus compañías y las acciones ingeniosas que tomaron para aumentar los Imperios corporativos globales de Apple Computer Inc. y Microsoft Corporation.', './posters/37.jpg', 'Suceso Real', NULL, '104 minutos', 'Piratas de Silicon Valey, Pirates of Silicon Valley, Noah Wyle, Anthony Michael, Joey Slotnick, J.G. Hertzler, Wayne Pére, Sheila Shaw, Gemma Zamprogna, John DiMaggio, Drama, Historia, Comedia, Suceso Real, Steve Jobs, Bill Gates, Microsoft, Apple, Xerox, Cupertino, Redmond', 'https://www.youtube.com/embed/lEyrivrjAuU', 2);
VALUES (38, 'Red Social', 'En una noche de otoño de 2003, el genio de la programación de computación de la Universidad de Harvard Mark Zuckerberg se sienta en su computadora y acaloradamente comienza a trabajar en una nueva idea. En una furia de los blogs y la programación, lo que comienza en su dormitorio como un pequeño sitio entre amigos pronto se convierte en una red social global y una revolución en la comunicación. A sólo seis años y 500 millones de amigos más tarde, Mark Zuckerberg es el multimillonario más joven de la historia ... pero para este empresario, el éxito conduce a complicaciones tanto personales como legales.', './posters/38.jpg', 'Suceso Real', NULL, '116 minutos', 'Red Social The Social Network Facebook Drama, Historia, Tecnología Jesse Eisenberg, Andrew Garfield, Justin Timberlake, Armie Hammer, Max Minghella, Rooney Mara, Brenda Song, Rashida Jones, John Gertz', 'https://www.youtube.com/embed/lB95KLmpLR4', 2);
VALUES (39, 'Antitrust', 'Milo Hoffman es un joven informático increíblemente prometedor para su edad que rápidamente es contratado por una importante empresa de Sillicon Valley. El empleo de sus sueños se ha hecho realidad, ya que ahí puede trabajar con los ordenadores más potentes del mundo y con las últimas tecnologías que aún no han salido al mercado. El Paraíso de un informático. Su jefe, Gary Winston , es un poderoso pez gordo de la industria que en un principio parece un tipo íntegro y legal. Pero pronto descubrirá que fisgar en sus archivos secretos no es la mejor idea si uno quiere conservar su trabajo... y su vida.', './posters/39.jpg', 'Acción', NULL, '110 minutos', 'Antitrust Acción, Suspenso, Drama Ryan Phillippe, Rachael Leigh Cook, Tim Robbins, Claire Forlani, Richard Rountree, Tygh Runyan, Ned Bellamy, Tyler Labine', 'https://www.youtube.com/embed/k3TwIJjyjPM', 2);
VALUES (40, 'Stowaway', 'Una misión al planeta Marte. Dos años de duración. De repente, los tres tripulantes afectados a esta labor deben tomar una decisión imposible cuando un pasajero imprevisto compromete la vida de todos a bordo. No hay vuelta atrás. La decisión deberá tomarse contemplando la vida de los, ahora, cuatro pasajeros aún cuando la supervivecnaia tenga que acarrear algún sacrificio.', './posters/40.jpg', 'Ciencia Ficción', NULL, '118 minutos', 'Stowaway El cuarto pasajero El 4º pasajero Fourth Passenger Drama, Ciencia ficción, Suspenso Anna Kendrick, Daniel Dae Kim, Shamier Anderson, Toni Collette', 'https://www.youtube.com/embed/A_apvQkWsVY', 2);
VALUES (41, 'Liga de la Justicia - Zack Snyder', 'Decidido a asegurarse de que el sacrificio final de Superman no fue en vano, Bruce Wayne alinea fuerzas con Diana Prince con planes para reclutar un equipo de metahumanos para proteger al mundo de una amenaza de proporciones catastróficas que se aproxima. En esta fascinante entrega, no apta para niños, verás cómo se conforma la Liga de la Justicia, uniendo a los principales superhéroes conocidos como Metahumanos.', './posters/41.jpg', 'Acción', NULL, '242 minutos', 'Liga de la Justicia - Zack Snyder Justice League DC Comics Acción, Aventura, Ciencia ficción, Fantasía Ben Affleck, Henry Cavill, Gal Gadot, Jason Momoa, Ezra Miller, Ray Fisher, Amy Adams, Jeremy Irons, Connie Nielsen', 'https://www.youtube.com/embed/BUb_-RxsoBs', 2);
VALUES (42, 'Two and a half men', 'Un quiropráctico y padre soltero, Alan Harper, vive en una casa al frente de la playa con su hijo mediocre, Jake, y un billonario de la Internet divorciado Walden Schmidt, que se muda con la familia de los Harper y ofrece comprar la casa luego de la muerte inesperada del hermano de Alan, Charlie, que era el propietario de la casa en la que vivía con Alan y Jake, luego de que padre e hijo se mudaran después del divorcio de Alan. La exesposa de Alan y madre de Jake, Judith, permanece en sus vidas.', './posters/42.jpg', 'Comedia', 12, 'N/A', 'Two and a half men Dos hombres y medio Familia, Comedia, Aventura Charlie Sheen, Jon Cryer, Angus T. Jones, Conchata Ferrel, Holland Taylor, Marin Hinkle, Jennifer Bini Taylor, Melanie Lynskey, Ashton Kutcher, Amber Tamblyn', 'https://www.youtube.com/embed/mVHDanSl2pc', 1);
VALUES (43, 'La casa de Papel', 'Ocho ladrones toman rehenes en la Fábrica Nacional de Moneda y Timbre de España, mientras el líder de la banda manipula a la policía para cumplir con su plan.', './posters/43.jpg', 'Acción', 4, 'N/A', 'La casa de Papel Aventura, Drama, Acción Úrsula Corberó, Álvaro Morte, Itziar Ituño, Pedro Alonso, Alba Flores, Miguel Herrán, Jaime Lorente, Esther Acebo, Enrique Arce, robo, atraco, máscaras, da vinci, moneda, casa de moneda, Casa de la Moneda, timbrado, Timbrado', 'https://www.youtube.com/embed/w1jkStuRQU8', 1);
VALUES (44, 'Stranger Things', 'Pasan cosas muy extrañas en Hawkins, Indiana, tras una desaparición que revela la presencia de una niña con poderes sobrenaturales. Después de la extraña desaparición de un niño, un pueblo se encuentra ante un misterio que revela experimentos secretos, fuerzas sobrenaturales.', './posters/44.jpg', 'Suspenso', 4, 'N/A', 'Stranger Things Misterio, Suspenso, Familia Winona Ryder, David Harbour, Finn Wolfhard, Millie Bobby Brown, Gaten Matarazzo, Caleb McLaughlin, Natalia Dyer, Charlie, Heaton, Joe Keery, espacio, Space, Espacio, space, película del espacio', 'https://www.youtube.com/embed/b9EkMc79ZSU', 1);
VALUES (45, 'Gravity', 'Durante un paseo espacial rutinario, dos astronautas sufren un grave accidente y quedan flotando en el espacio. Una es la doctora Ryan Stone, una brillante ingeniera en su primera misión espacial en la Shuttle. Su acompañante es el veterano astronauta Matt Kowalsky. Durante el paseo algo sale mal y ocurre el desastre: el shuttle queda destrozado, dejando a Ryan y Matt completamente solos, momento a partir del cual intentarán por todos los medios volver a la Tierra.', './posters/45.jpg', 'Suspenso',null , '93 minutos', 'Gravity, Gravedad, Suspenso, Ciencia ficción, Drama, Sandra Bullock, George Clooney, Ed Harris, Orto Ignatiussen, Phaldut Sharma, Amy Warren, Basher Savage, Adam Cozens', 'https://www.youtube.com/embed/OiTiKOy59o4', 2);
VALUES (49, 'It (eso)', 'Remake del clásico de Stephen King, y de la película homónima de 1990, en el que un payaso aterroriza a los niños de un vecindario. En un pequeño pueblo de Maine, siete niños conocidos como el Club de los Perdedores se encuentran cara a cara con problemas de la vida, matones y un monstruo que toma la forma de un payaso llamado Pennywise..', './posters/49.jpg', 'Terror',null , '135 minutos', 'It, IT, Eso, eso, Terror, Suspenso, Drama, Jaeden Martell, Jeremy Ray, Sophia Lillis, Finn Wolfhard, Chosen Jacobs, Jack Dylan, Wyatt Oleff, Bill Skarsgård, Nicholas Hamilton, Maine, Loosers, Los Perdedores, Stephen King, Pennywise', 'https://www.youtube.com/embed/FnCdOQsX5kc', 2);
VALUES (46, 'Apollo 13', 'El Apolo 13 inicia su viaje a la luna en abril de 1970. Cuando la tripulación está a punto de llegar a su destino, una explosión en el espacio les hace perder oxígeno, energía y el curso de la nave... Todo se convierte en una situación desesperada para los tres hombres tripulantes, especialmente cuando el oxígeno amenaza con agotarse. Mientras, el mundo entero, que apenas un año antes conoció la gloria de la aventura espacial cuando el hombre pisó la luna, contiene la respiración a la espera de ver cómo acaba tan angustiosa espera.', './posters/46.jpg', 'Suceso Real',null, '140 minutos', 'Apollo 13 Apolo 13 Drama, Historia, Suceso Real, Tom Hanks, Bill Paxton, Kevin Bacon, Gary Sinise, Ed Harris, Kathleen Quinlan, Roger Corman, Chris Ellis, Xander Berkeley', 'https://www.youtube.com/embed/e3ZtOS4MCkk', 2);
VALUES (47, 'La profecía', 'Incapaz de decirle a su mujer Katherine la trágica muerte de su hijo recién nacido, el diplomático americano Robert Thorn acepta un huérfano como su hijo. Los detalles del nacimiento del chico son un secreto, pero cuando Damien va creciendo, empieza a dar muestras de que no es un chico corriente.', './posters/47.jpg', 'Terror',null , '110 minutos', 'La profecía, The Prophecy, The Omen, The Omeh, Terror, Suspenso, Drama, Liev Schreiber, Julia Stiles, Seamus Davey-Fitzpatrick, David Thewils, Pete Postlethwaite, Mia Farrow, Predrag Bjelac, Carlo Sabatini, Amy Huck', 'https://www.youtube.com/embed/8L-1Qk_MQQs', 2);
VALUES (48, 'El exorcista', 'Regan es una niña de doce años víctima de fenómenos paranormales como la levitación o la manifestación de una fuerza sobrehumana. Su madre, aterrorizada, tras someter a su hija a múltiples análisis médicos que no ofrecen ningún resultado, acude a un sacerdote con estudios de psiquiatría. Éste está convencido de que el mal no es físico sino espiritual, es decir, que la niña es víctima de una posesión diabólica. Por eso, con la ayuda de otro sacerdote decide practicar un exorcismo.', './posters/48.jpg', 'Terror',null , '122 minutos', 'El exorcista, The exorcist, Terror, Suspenso, Drama, Ellen Burstyn, Linda Blair, Max vox Sydow, Lee J. Cobb, Kitty Winn, Jack MacGowran, Jason Miller, William O''Malley, Barton Heyman', 'https://www.youtube.com/embed/YDGw1MTEe9k', 2);
VALUES (50, 'The Office', 'Steve Carell protagoniza The Office, un fresco y divertido vistazo, con formato pseudo-documental, al día a día en la vida de unos excéntricos trabajadores de la empresa Dunder Mifflin. El serio pero despistadísimo director Michael Scott se considera un magnífico jefe y mentor, pero realmente inspira más críticas que respeto a sus empleados.', './posters/50.jpg', 'Comedia', 9, 'N/A', 'The Office, La Oficina, Comedia, Familia, Rainn Wilson, Steve Carell, Jenna Fischer, John Krasinski, B.J. Novak, Kate Flannery, Brian Baumgartner, Leslie David Baker, Mindy Kaling, Angela Kinsey', 'https://www.youtube.com/embed/LHOtME2DL4g', 1);
VALUES (51, 'The Good Doctor', 'Un cirujano joven y autista que padece el síndrome del sabio empieza a trabajar en un hospital prestigioso. Allá tendrá que vencer el escepticismo con el que sus colegas lo reciben.', './posters/51.jpg', 'Familia', 4, 'N/A', 'The Good Doctor, El buen Doctor, Drama, Familia, Freddie Highmore, Antonia Thomas, Hill Harper, Richard Schiff, Christina Chang, Paige Spara, Fiona Gubelmann, Will Yun Lee, Nicholas Gonzalez', 'https://www.youtube.com/embed/fYlZDTru55g', 1);
VALUES (52, 'La teoría del todo', 'La película gira en torno a la vida de Stephen Hawking, el importante teórico y divulgador científico que cambió la historia de la ciencia y la tecnología moderna para siempre. La película se centrará en la relación que mantuvo el británico con Jane Wilde, su primera mujer, con quien contrajo matrimonio después de que le diagnosticaran una enfermedad por la que no le quedaban más de dos años de vida. Estupenda adaptación con un Eddie Redmayne que cada día nos sorprende más.', './posters/52.jpg', 'Suceso Real', NULL, '123 minutos', 'La teoría del todo, la teoria del todo, The theory of everything, Drama, Romance, Suceso Real, Eddie Redmayne, Felicity Jones, Charlie Cox, Emily Watson, Simon McBurney, David Thewlis, Maxine Peake, Harry Lloyd, Tom Prior', 'https://www.youtube.com/embed/Salz7uGp72c', 2);
VALUES (53, 'Código enigma', 'Durante el invierno de 1952, las autoridades británicas entraron en el hogar del matemático, analista y héroe de guerra Alan Turing, con la intención de investigar la denuncia de un robo. Al final acabaron arrestando a Turing acusándole de indecencia grave, un cargo que le supondría una devastadora condena por una ofensa criminal: ser homosexual. Los oficiales no tenían ni idea de que en realidad estaban incriminando al pionero de la informática actual. Liderando a un heterogéneo grupo de académicos, lingüistas, campeones de ajedrez y oficiales de inteligencia, se le conoce por haber descifrado el código de la inquebrantable máquina Enigma de los alemanes durante la Segunda Guerra Mundial.', './posters/53.jpg', 'Suceso Real', NULL, '115 minutos', 'Código enigma, Enigma, Code, The Imitation Game Descifrando Enigma, Drama, Historia, Suspenso, Suceso Real, Benedict Cumberbatch, Keira Knightley, Matthew Goode, Rory Kinnear, Allen Leech, Matthew Beard, Charles Dance, Mark Strong, James Northcote', 'https://www.youtube.com/embed/nuPZUUED5uk', 2);
VALUES (54, 'Talentos ocultos', 'Narra la historia nunca contada de tres brillantes mujeres científicas afroamericanas que trabajaron en la NASA a comienzos de los años sesenta (en plena carrera espacial, y asimismo en mitad de la lucha por los derechos civiles de los negros estadounidenses) en el ambicioso proyecto de poner en órbita al astronauta John Glenn.', './posters/54.jpg', 'Suceso Real', NULL, '127 minutos', 'Talentos ocultos, talentos ocultos, hidden figures, Hidden Figures, Figuras ocultas, figuras, Drama, Historia, Suspenso, Suceso Real, Taraji P. Henson, Octavia Spencer, Janelle Monáe, Kevin Costner, Kirsten Dunst, Jim Parsons, Mahershala Ali, Glen Powell, Ariana Neal', 'https://www.youtube.com/embed/RK8xHq6dfAo', 2);
VALUES (55, 'Una mente brillante', 'Obsesionado con la búsqueda de una idea matemática original, el brillante estudiante John Forbes Nash llega a Princeton para realizar sus estudios de postgrado. Es un muchacho extraño y solitario, al que sólo comprende su compañero de cuarto. Por fin, Nash esboza una revolucionaria teoría y consigue una plaza de profesor en el MIT. Alicia Lardé, una de sus alumnas, lo deja fascinado al mostrarle que las leyes del amor están por encima de las de las matemáticas. Gracias a su prodigiosa habilidad para descifrar códigos es reclutado por Parcher William, del departamento de Defensa, para ayudar a los Estados Unidos en la Guerra Fría contra la Unión Soviética.', './posters/55.jpg', 'Suceso Real', NULL, '134 minutos', 'A brilliant mind, a beautiful mind, Una mente brillante, Una mente maravillosa, Drama, Historia, Romance, Suceso Real, Russell Crowe, Jennifer Connelly, Ed Harris, Paul Bettany, Christopher Plummer, Josh Lucas, Adam Goldberg, Anthony Rapp, Judd Hirsch', 'https://www.youtube.com/embed/jT51irTIrAc', 2);
VALUES (56, 'Passengers', 'Una nave espacial, que viaja a un planeta lejano transportando a miles de personas, tiene una avería en una de las cápsulas de hibernación tras el impacto con un gran meteorito. Como resultado, un pasajero se despierta noventa años antes del final del viaje.', './posters/56.jpg', 'Ciencia Ficción', NULL, '116 minutos', 'Passengers, passengers, Pasajeros, Jennifer Lawrence, Chris Pratt, Michael Sheen, Laurence Fishburne, Andy García, Aurora Perrineau, Kristin Brock, Julee Cerda, Fred Melamed, Drama, Romance, Sci-Fi, Ciencia Ficción', 'https://www.youtube.com/embed/7BWWWQzTpNU', 2);
VALUES (57, 'Passengers', 'Un avión se estrella y tan sólo sobreviven cinco personas. Asignada al caso por su mentor, la joven terapeuta Claire, una brillante psicóloga, deberá ayudar a los supervivientes a superar el trauma. Pero, poco a poco, éstos empiezan a desaparecer misteriosamente... o a no aparecer en la sesiones. Nada está claro, ni siquiera qué pasó en el accidente. Además, entre los supervivientes está Eric, un atractivo pasajero que parece no necesitar terapia. (la línea entre este mundo y el próximo, está a pundo de ser cruzada)', './posters/57.jpg', 'Suspenso', NULL, '93 minutos', 'Passengers, passengers, Pasajeros, Jennifer Lawrence, Anne Hathaway, Patrick Wilson, Andre Braugher, Dianne Wiest, David Morse, William B. Davis, Ryan Robbins, Clea DuVall, Don Thompson, Drama, Romance, Misterio, Suspenso', 'https://www.youtube.com/embed/iMW4RpQmJJQ', 2);
VALUES (58, 'Argo', 'Irán, año 1979. Cuando la embajada de los Estados Unidos en Teherán es ocupada por seguidores del Ayatolá Jomeini para pedir la extradición del Sha de Persia, la CIA y el gobierno canadiense organizaron una operación para rescatar a seis diplomáticos estadounidenses que se habían refugiado en la casa del embajador de Canadá. Con este fin se recurrió a un experto en rescatar rehenes y se preparó el escenario para el rodaje de una película de ciencia-ficción, de título ''Argo'', en la que participaba un equipo de cazatalentos de Hollywood. La misión: ir a Teherán y hacer pasar a los diplomáticos por un equipo de filmación canadiense para traerlos de vuelta a casa.', './posters/58.jpg', 'Suceso Real', NULL, '120 minutos', 'Argo, Drama, Suspenso, Suceso Real, Ben Affleck, Bryan Cranston, Alan Arkin, Jogn Goodman, Victor Garber, Tate Donovan, Clea DuVall, Scoot McNairy, Rory Cochrane, Kerry Bishé, Argo Fuck Yourself', 'https://www.youtube.com/embed/JW3WfSFgrVY', 2);
VALUES (59, 'Prometheus', 'Un grupo de científicos y exploradores emprende un viaje espacial a un remoto planeta, una rara estrella recién descubierta, donde sus límites físicos y mentales serán puestos a prueba. El motivo de la misión es que los humanos creen que allá podrán encontrar la respuesta a las preguntas más profundas y al mayor de los misterios: el origen de la vida en la Tierra.', './posters/59.jpg', 'Ciencia Ficción', NULL, '120 minutos', 'Prometheus, Prometeo, prometeus, prometeo, Ciencia Ficción, Aventura, Misterio, Noomi Rapace, Michael Fassbender, Charlize Theron, Logan Marshall-Green, Guy Pearce, Idris Elba, Sean Harris, Rafe Spall, Kate Dickie, Emut Elliott, Benedict Wong, Lucy Hutchinson', 'https://www.youtube.com/embed/34cEo0VhfGE', 2);
VALUES (60, 'Alien: Covenant', 'Rumbo a un remoto planeta al otro lado de la galaxia, la tripulación de la nave colonial Covenant descubre lo que creen que es un paraíso inexplorado, pero resulta tratarse de un mundo oscuro y hostil cuyo único habitante es un ''sintético'' llamado David (Michael Fassbender), superviviente de la malograda expedición Prometheus. Secuela de ''Prometheus'' (2012), a su vez precuela de ''Alien, el octavo pasajero'' (1979).', './posters/60.jpg', 'Ciencia Ficción', NULL, '122 minutos', 'Alien, Covenant, Alien: Covenant, Prometheus, Prometeo, prometeus, prometeo, Ciencia Ficción, Aventura, Misterio, Michael Fassbender, Katherine Waterston, Billy Crudup, Danny McBride, Demián Bichir, Carmen Ejogo, Jussie Smollett, Callie Hernandez, Amy Seimetz, Nathaniel Dean, Alexander England, Benjamin Rigby, Uli Latukefu, Tess Haubrich, Andrew Crawford, Guy Pierce, James Franco, Noomi Rapace, Javier Botet', 'https://www.youtube.com/embed/svnAD0TApb8', 2);
VALUES (61, 'Life: Vida inteligente', 'Seis miembros de la tripulación de la Estación Espacial Internacional que están a punto de lograr uno de los descubrimientos más importantes en la historia humana: la primera evidencia de vida extraterrestre en Marte. A medida que el equipo comienza a investigar y sus métodos tienen consecuencias inesperadas, la forma viviente demostrará ser más inteligente de lo que cualquiera esperaba.', './posters/61.jpg', 'Suspenso', NULL, '106 minutos', 'Life: Vida inteligente, Ciencia Ficción, Suspenso, Terror, Jake Gyllenhaal Rebecca Ferguson, Ryan Reynolds, Hiroyuki Sanada, Airyon Bakare, Olga Dihovichnaya, Naoko Mori, Haruka Kuroda Camiel Warren-Taylor, Kalvin, kalvin, calvin, Calvin', 'https://www.youtube.com/embed/viX9irZw9Cg', 2);
VALUES (62, 'Madame Curie', 'Basada en el libro ''A tale of love and fallout'' de Lauren Redniss, Radioactive es la historia biográfica sobre la científica polaca Marie Curie, la primera persona en recibir dos premios Nobel en distintas especialidades —Física y Química—, y la primera mujer en ocupar el puesto de profesora en la Universidad de París. Dirigida por Marjane Satrapi y protagonizada por Rosamund Pike como Marie Curie, está basada en la novela gráfica de Lauren Redniss.', './posters/62.jpg', 'Suceso Real', NULL, '115 minutos', 'Radioactive, Radioactividad, Radioactiva, Radioactivo, Madame Curie, Drama, Romance, Historia, Suceso Real, Marie Curie, Marie Sklodowska-Curie, Rosamund Pike, Sam Riley, Aneurin Barnard, Anya Taylor-Joy, Simon Russell Beale, Jonathan Aris, Corey Johnson, Tim Woodward, Katherine Parkinson', 'https://www.youtube.com/embed/w0jqppl-ybY', 2);
VALUES (63, 'The IT Crowd', 'En un desordenado sótano en las entrañas de Industrias Reynholm habitan Roy y Moss, los componentes del Departamento de informática. Víctimas del desprecio y del escarnio de sus compañeros más guays, su mundo de servidores y cortafuegos se ve interrumpido por la llegada de Jen, su nueva jefa, que sabe tanto de ordenadores como un yak.', './posters/63.jpg', 'Comedia', 4, 'N/A', 'Comedia, Los informáticos, the it crowd, The IT Crowd, croud, Chris O''Dowd, Richard Ayoade, Katherine Parkinson, Matt Berry, Noel Fielding, Peter Serafinowicz, Gragam Linehan, Tom Binns, Lewis Macleod', 'https://www.youtube.com/embed/wCa1jfo93jQ', 1);
VALUES (64, 'Humans', 'En un presente paralelo donde el último gadget que hay que tener para cualquier familia ocupada es un ''Synth'' - un sirviente robótico altamente desarrollado que es tan similar a un humano real que está transformando la manera en que vivimos.', './posters/64.jpg', 'Ciencia Ficción', 3, 'N/A', 'Ciencia Ficción, Sci-Fi, Fantasía, Drama, Misterio, Humans, Humanos, humans, humanos, Katherine Parkinson, Gemma Chan, Emily Berrington, Lucy Carless, Colin Morgan, Theo Stevenson, Pixie Daves, Tom Goodman-Hill, Ivanno Jeremiah, Ruth Bradley, Will Tudor, Neil Maskell, Billy Jenkins, Bella Dayne, Thusitha Jayasumdera, Danny Webb, Carrie-Anne Moss, William Hurt, Synth, synth, sintético, sintetico', 'https://www.youtube.com/embed/BV8qFeZxZPE', 1);
VALUES (65, 'Need for Speed', 'El más famoso de los videojuegos de carreras llega a la gran pantalla para dejar a los más fanáticos boquiabiertos. Need for Speed cuenta la historia de un experto en automovilismo (Aaron Paul), el cual tiene un garage en dónde transforma coches para hacerlos más rápidos de lo que son para poder competir en carreras ilegales. Entró en la cárcel por un delito que no había cometido, justo cuando su mejor amigo muere en una carrera, y ahora sale de allí para vengarse.', './posters/65.jpg', 'Acción', NULL, '130 minutos', 'Need for Speed, Acción, Drama, Suspenso, Aaron Paul, Dominic Cooper, Imogen Poots, Ramón Rodríguez, Michael Keaton, Rami Malek, Kid Cudi, Dakota Johnson, Harrison Gilbertson, Carmela Zumbado, Jalil Jay Lynch, Nick Chinlund, Chad Randall', 'https://www.youtube.com/embed/u3wtVI-aJuw', 2);
VALUES (66, 'Mare of Easttown', 'Mare of Easttown es una miniserie estadounidense de drama y misterio creada por Brad Ingelsby cuenta la historia de Mare Sheehan, una detective de un pequeño pueblo de Pensilvania que investiga un asesinato local mientras trata de evitar que su vida se desmorone a raiz de la muerte de su hijo, su separación, y la posible restitución de su nieto a su madre biológica.', './posters/66.jpg', 'Drama', 1, 'N/A', 'Mare of Easttown, Misterio, Drama, Crimen, Suspenso, Kate Winslet, Julianne Nicholson, Jean Smart, Angourie Rice, Evan Peters, Sosie Bacon, David Denman, Neal Huff, James McArdle, Guy Pearce, Cailee Spaeny, John Douglas Thompson, Joe Tippett, Cameron Mann, Chinasa Ogbuagu, Mare Sheehan', 'https://www.youtube.com/embed/miQqyfO66uw', 1);
VALUES (67, 'Ray', 'La vida de Ray Charles es una alternancia de triunfos y fracasos personales que se suceden a lo largo de una dilatada y galardonada carrera en el mundo del espectáculo. Pero estamos hablando de un hombre que sintetizó sus luchas, su dolor y su oscuridad personal con la misma efectividad con la que supo fundir en su arte una miríada de estilos musicales: el jazz, el rhythm & blues, el rock & roll, el gospel y el country. Su historia tiene entonces un sentido muy distinto: la cadena de logros se transforma en el vibrante y conmovedor trayecto de un genio único con una visión propia que enseñó al mundo a escuchar música de una forma nueva. RAY es la biografía, nunca contada antes, de esa leyenda de la música americana que es Ray Charles. Se centra en el período más explosivo de la carrera de Charles, que comienza cuando este joven negro ciego se sube solo a un autobús en Florida y cruza el país para refinar su arte en la floreciente escena jazzística de Seattle.', './posters/67.jpg', 'Suceso Real', NULL, '152 minutos', 'Ray, Ray Charles, ray charles, Jamie Foxx, Kerry Washington, Regina King, Harry Lennix, Clifton Powell, Bokeem Woodbine, Sharon Warren, C.J. Sanders, Curtis Armstrong, hit the road jack', 'https://www.youtube.com/embed/jVHCQfcugdw', 2);
VALUES (68, 'Black Mirror', 'Black Mirror es una serie de televisión británica creada por Charlie Brooker que muestra el lado oscuro de la vida y la tecnología. La serie es producida por Zeppotron para Endemol. En cuanto al contenido del programa y la estructura, Brooker ha señalado que ''cada episodio tiene un tono diferente, un entorno diferente, incluso una realidad diferente, pero todos son acerca de la forma en que vivimos ahora - y la forma en que podríamos estar viviendo en 10 minutos si somos torpes''.', './posters/68.jpg', 'Ciencia Ficción', 5, 'N/A', 'Black mirror, black mirror, Drama, Ciencia Ficción, Fantasía, Michaela Coel, Daniel Lapaine, Hannah John-Kamen, Andrew Roux, Claire Keelan, Sinéad Matthews, Anna Wilson-Jones, Paul Popplewell, Julia Davis, Ashely Thomas, Kerrie Hayes, Amy Beth Hayes, Rebekah Staton, Rhashan Stone, Phoebe Fox, Jimi Mistry, Tobias Menzies, Cherry Jones, Alice Eve, Susannah Fielding, Demetri Goritsas, Kadiff Kirwan, Sope Dirisu, Jackson Bews, Annabel Davis, Billy Griffin Jr., Paul Lawrence Kitson, Jeff Mash Patrick Kennedy, Lydia Wilson, Alastair Mackenzie, Chetna Pandya, Tuppence Middleton, Ian Bonar, Elisabeth Hopper, Nick Bartlett, Wunmi Mosaku, Alex Lawther, Jerome Flynn, Susannah Doyle, Madeline Brewer, Ariane Labed, Sarah Snook, Michael Kelly, Jola Bokinni, Faye Marsay, Benefict Wong, Jonas Karlsson, Chloe Pirrie, Eugene O''Hare, Indira Ainger, James Lance, David Ajala, Sarah Abbott, Maxine Peake, Jake Davies, Clint Dyer, Letitia Wright, Babs Olusanmokun, Georgina Campbell, Jesse Plemons, Jimmi Simpson, Aaron Paul, Aldis Hodge, Kiran Sonia Sawar, Miley Cyrus, Anthony Mackie, Nicole Beharie, Bryce Dallas Howard, Mackenzie Davis, Gugu Mbatha-Raw', 'https://www.youtube.com/embed/jVHCQfcugdw', 1);
VALUES (69, 'Detrás de sus ojos', 'Una madre soltera se adentra en un mundo de retorcidos juegos psicológicos cuando inicia una relación cuasi-no consentida con su jefe, un psiquiatra, y se hace amiga en secreto de su misteriosa esposa. La trama se bassa en un thriller sobre un triángulo amoroso perverso, más la introducción sutilmente de un elemento clave, que dará un giro notable a la obra.', './posters/69.jpg', 'Drama', 1, 'N/A', 'Detrás de sus ojos, Behind her eyes, Drama, Suspenso, Crimen, Simona Brown, Eve Hewson, Toma Bateman, Robert Aramayo, Tyler Howitt, Georgie Glen, Kamontip Krissy Ashton, Rob Horrocks, Joakim Skarli', 'https://www.youtube.com/embed/c4LtoWQaLxk', 1);
VALUES (70, 'Her', 'En un futuro cercano, Theodore, un hombre solitario a punto de divorciarse que trabaja en una empresa como escritor de cartas para terceras personas, compra un día un nuevo sistema operativo basado en el modelo de Inteligencia Artificial, diseñado para satisfacer todas las necesidades del usuario. Para su sorpresa, se crea una relación romántica entre él y Samantha, la voz femenina de ese sistema operativo.', './posters/70.jpg', 'Ciencia Ficción', NULL, '126 minutos', 'Drama, Sci-Fi, Ciencia Ficción, Romance, Her, her, Ella, ella, Joaquin Phoenix, Scarlett Johansson, Amy Adams, Rooney Mara, Olivia Wilde, Chris Pratt, Matt Letscher, Portia Doubleday, Spike Jonze', 'https://www.youtube.com/embed/UVMcpZ42BkA', 2);
VALUES (71, 'Misión Imposible', 'Ethan Hunt es un superespía capaz de resolver cualquier arriesgada situación con la máxima elegancia. Forma parte de un competente equipo dirigido por el agente Jim Phelps, que ha vuelto a reunir a sus hombres para participar en una dificilísima misión: evitar la venta de un disco robado que contiene información secreta de vital importancia.', './posters/71.jpg', 'Acción', NULL, '110 minutos', 'Drama, Acción, Romance, Misión Imposible, misión imposible, mission impossible, Mission Impossible, Tom Cruise, Jon Voight, Emmanuelle Béart, Henry Czerny, Jean Reno, Ving Rhames, Kristin Scott Thomas, Vanessa Redgrave, Ingeborga Dapkünaitè', 'https://www.youtube.com/embed/Ohws8y572KE', 2);
VALUES (72, 'El agente de C.I.P.O.L.', 'Guerra fría, años 60. Narra las aventuras de dos agentes secretos que se parecen más de lo que creen: Napoleon Solo, de la CIA, e Illya Kuryakin, del KGB. Ambos se ven obligados a olvidar sus diferencias y formar un equipo cuya misión será poner fin a una misteriosa organización criminal internacional que pretende desestabilizar el frágil equilibrio de poder provocado por la proliferación de las armas nucleares. La hija de un científico alemán desaparecido es la clave para infiltrarse en la organización, encontrar al científico y evitar una catástrofe mundial.', './posters/72.jpg', 'Acción', NULL, '116 minutos', 'Drama, Acción, Aventura, Comedia, The Man from, the man from, Operación U.N.C.L.E., UNCLE, uncle u.n.c.l.e., El agente de CIPOL, Cipol, C.I.P.O.L., Henry Cavill, Armie Hammer Alicia Vikander, Elizabeth Debicki, Luca Calvani, Sylvester Groth, Hugh Grant, Jared Harris, Christian Berkel, Misha Kuznetsov, Guy Williams, Marianna Di Martino', 'https://www.youtube.com/embed/AeUzNxHHryQ', 2);
VALUES (73, 'Jumanji - Bienvenidos a la jungla', 'Cuatro adolescentes son absorbidos por un videojuego, en el que se convierten en avatares de personajes arquetípicos. Allí vivirán múltiples aventuras, al tiempo que buscan cómo salir de allí para volver a su mundo.', './posters/73.jpg', 'Fantasía', NULL, '119 minutos', 'Jumanji - Welcome to the Jungle, Bienvenidos a la jungla, Comedia, Ficción, Aventura, Fantasía, Dwayne Johnson, Kevin Hart, Jack Black, Karen Gillan, Nick Jonas, Rhys Darby, Bobby Cannavale, Alex Wolff, Ser''Darius Blain, Madison Iseman, Morgan Turner, Sean Buxton, Mason Guccione, Marin Hinkle, Colin Hanks', 'https://www.youtube.com/embed/2QKg5SZ_35I', 2);
VALUES (21, 'Jumanji - The next level', 'Las aventuras continúan en el fantástico mundo del video juego Jumanji, donde nada es lo que parece. En esta ocasión, los jugadores vuelven al juego, pero sus personajes se han intercambiado entre sí, lo que ofrece un curioso plantel: los mismos héroes con distinta apariencia y habilidades. Pero, ¿dónde está el resto de la gente?', './posters/21.jpg', 'Fantasía', NULL, '97 minutos', 'Jumanji - The next level, Comedia, Ficción, Aventura, Dwayne Johnson, Kevin Hart, Jack Black, Karen Gillan, Awkwafina, Nick Jonas, Rhys Darby, Bobby Cannavale, Alex Wolff, Ser''Darius Blain, Madison Iseman, Morgan Turner, Sean Buxton, Mason Guccione, Marin Hinkle, Colin Hanks, Danny DeVito, Danny Glover', 'https://www.youtube.com/embed/rBxcF-r9Ibs', 2);
VALUES (74, 'Mujer Maravilla 1984', 'En 1984, en plena guerra fría, Diana Prince, conocida como La Mujer Maravilla, se enfrenta al empresario Maxwell Lord y a su antigua amiga Barbara Minerva / Cheetah, una villana que posee fuerza y agilidad sobrehumanas.', './posters/74.jpg', 'Fantasía', NULL, '151 minutos', 'Wonder Woman 1984, Mujer Maravilla, wonder woman, mujer maravilla, Gal Gadot, Chris Pine, Kristen Wiig, Pedro Pascal, Robin Wright, Connie Nielsen, Lilly Aspell, Amr Waked, Kristoffer Polaha', 'https://www.youtube.com/embed/sfM7_JLk-84', 2);
VALUES (75, 'El Contador', 'Christian Wolff es un contable y genio matemático, un hombre obsesivo con el orden y con mucha más afinidad con los números que con las personas, que lleva una doble vida como asesino despiadado.', './posters/75.jpg', 'Aventura', NULL, '128 minutos', 'El contador, El Contador, el contador, The accountant, El contable, Aventura, Acción, Suspenso, Crimen, Drama, Christian Wolff, Ben Affleck, Anna Kendrick, J.K. Simmons, Jon Bernthal, Jeffrey Tambor, Cynthia Addai-Robinson, John Lithgow, Jean Smart, Andy Umberger, Alison Wright, Daeg Faerch, Seth Lee, Tait Fletcher, Angel Giuffria, Ron Yuan, Scott Hunter, Dennis Keiffer, Jake Presley', 'https://www.youtube.com/embed/DBfsgcswlYQ', 2);
VALUES (76, 'Mala Educación', 'Frank Tassone, uno de los superintendentes más destacados del distrito escolar de Roslyn en Nueva York se desvive a diario para que la educación de sus alumnos sea la mejor. Pero de forma paralela, este se lucra con dinero público para llevar una vida llena de lujos. Así, Tassone y su personal, amigos y familiares, se convierten en los principales sospechosos del mayor escándalo de malversación de fondos ocurrido en una escuela pública de toda la historia de los Estados Unidos. (Algunas personas aprenden de manera difícil.)', './posters/76.jpg', 'Suceso Real', NULL, '108 minutos', 'Mala Educación, Bad Education, mala educación, bad education, Suceso Real, Drama, Historia, Hugh Jackman, Allison Janney, Geraldine Viswanathan, Alex Wolff, Rafael Casal, Stephen Spinella, Annaleigh Ashford, Ray Romano, Hari Dhillon, Jerremy Shamos, Stephanie Kurtzuba, Catherine Curtin, Kathrine Narducci, Ray Abruzzo, Frank Tassone, La Estafa, la estafa, algunas personas aprenden de manera difícil', 'https://www.youtube.com/embed/DBfsgcswlYQ', 2);
VALUES (78, 'Noche en el Museo', 'Un padre divorciado trata de establecerse, impresionar a su hijo y encontrar su destino. Él se presenta para un trabajo como vigilante nocturno en el Museo Americano de Historia Natural de la ciudad de Nueva York y, posteriormente, descubre que los objetos expuestos, animados por un artefacto mágico de Egipto, vuelven a la vida durante la noche. Al principio le va muy mal tratando de mantener el orden y la calma en el museo, pero al final se vuelve muy buen amigo de todos y juntos ayudan a recuperar aquel artefacto mágico egipcio, ya que ha sido robado por los antiguos vigilantes del museo.', './posters/78.jpg', 'Aventura', NULL, '108 minutos', 'Noche en el museo, una noche en el museo, Night at the Museum, Aventura, Ciencia Ficción, Comedia, Familia, Acción, Ben Stiller, Robin Williams, Carla Gugino, Dick Van Dyke, Steve Coogan, Jake Cherry, Mickey Rooney, Bill Cobbs, Owen Wilson, Ricky Gervais, Kim Raver, Rami Malek, Mizuo Peck', 'https://www.youtube.com/embed/B2G-8raHvOU', 2);
VALUES (79, 'Bohemian Rhapsody', 'Bohemian Rhapsody es una rotunda y sonora celebración de Queen, de su música y de su extraordinario cantante Freddie Mercury, que desafió estereotipos e hizo añicos tradiciones para convertirse en uno de los showmans más queridos del mundo. La película plasma el meteórico ascenso al olimpo de la música de la banda a través de sus icónicas canciones y su revolucionario sonido, su crisis cuando el estilo de vida de Mercury estuvo fuera de control, y su triunfal reunión en la víspera del Live Aid, en la que Mercury, mientras sufría una enfermedad que amenazaba su vida, lidera a la banda en uno de los conciertos de rock más grandes de la historia. Veremos cómo se cimentó el legado de una banda que siempre se pareció más a una familia, y que continúa inspirando a propios y extraños, soñadores y amantes de la música hasta nuestros días.', './posters/79.jpg', 'Suceso Real', NULL, '134 minutos', 'Bohemian Rhapsody, Rapsodia Bohemia, rapsodia bohemia, Queen, queen, Freddy Mercury, freddy mercury, Freddie Mercury, freddie mercury, Rami Malek, Gwilym Lee, Ben Hardy, Joseph Mazzello, Lucy Boynton, Aidan Gillen, Allen Leech, Tom Hollander, Mike Myers, Suceso Real, Drama, Historia, Música', 'https://www.youtube.com/embed/mP0VHJYFOAU', 2);
VALUES (80, 'Rock of ages', 'Los Ángeles, 1987: Un aspirante a roquero y una chica que trabajan en el mismo club (Bourbone Room) se enamoran y tratan de impedir que el local caiga en manos de unos empresarios que quieren demolerlo. Esta película es la adaptación cinematográfica del musical homónimo de Broadway.', './posters/80.jpg', 'Comedia', NULL, '123 minutos', 'La era del rock, Rock of ages, Música, Musical, Comedia, Romance, Drama, Julianne Hough, Diego Boneta, Tom Cruise, Alec Baldwin, Russell Brand, Malin Åkerman, Paul Giamatti, Bryan Cranston, Catherine Zeta-Jones, Mary J. Blige, Erica Frene, Shane Hartline, James Martin Kelly, Will Forte, Eli Roth, Bourbone Room, Wishky A-gogo', 'https://www.youtube.com/embed/mP0VHJYFOAU', 2);
VALUES (81, 'Super 8', 'Año 1979, en un pequeño pueblo de Ohio. Joe Lamb (Joel Courtney) es un muchacho que ha perdido a su madre en un accidente y que vive con su padre policía (Kyle Chandler). Comenzado el verano, y mientras rueda una película de zombis en Super 8 con sus amigos -y sobre todo con la bella Alice Dainard (Elle Fanning)-, Joe observa cómo una camioneta se estrella contra un tren de mercancías, provocando su descarrilamiento y un terrible accidente. A partir de ese momento cosas extrañas e inexplicables comienzan a suceder en el pueblo.', './posters/81.jpg', 'Ciencia Ficción', NULL, '82 minutos', 'Super 8, Suspenso, Ciencia ficción, Misterio, Sci-Fi, Joel Courtney, Elle Fanning, Riley Griffiths, Kyle Chandler, Noah Emmerich, AJ Michalka, Ryan Lee, Ron Eldard, Gabriel Basso', 'https://www.youtube.com/embed/QtZ6BQRDk4g', 2);
VALUES (82, 'Jurassic World - El reino caido', 'Tras cuatro años de abandono del complejo turístico Jurassic World, la isla Nublar solo está habitada por los dinosaurios supervivientes, pero el volcán inactivo de la isla comienza a cobrar vida, Owen y Claire montan una campaña para rescatar a los dinosaurios restantes en la isla.', './posters/82.jpg', 'Aventura', NULL, '82 minutos', 'Jurassic World - El reino caido, fallen kingdom, jurassic world, Jurassic Park, jurassic park, Chris Pratt, Bryce Dallas Howard, Rafe Spall, Justice Smith, Daniella Pineda, James Cromwell, Toby Jones, Ted Levine, Jeff Goldblum, BD Wong, Geraldine Chaplin, Isabella Sermon, Kevin Layne', 'https://www.youtube.com/embed/vn9mMeWcgoM', 2);
VALUES (83, 'Indiana Jones - y el Reino de la Calavera de Cristal', 'Guerra Fría (1957). Indiana Jones (Harrison Ford) y su amigo Mac (Ray Winstone) acaban de escapar de las garras de unos agentes soviéticos en un remoto aeropuerto. El decano de la Universidad (Jim Broadbent) le confiesa a su amigo el profesor Jones que las últimas misiones de Indy han fracasado y que está a punto de ser despedido. Mientras tanto, Indiana conoce a Mutt (Shia LaBeouf), un joven rebelde que le propone un trato: si le ayuda a resolver un problema personal, él, a cambio, le facilitaría uno de los descubrimientos más espectaculares de la historia: la Calavera de Cristal de Akator, que se encuentra en un lugar remoto del Perú. Pero los agentes soviéticos, dirigidos por la fría y bella Irina Spalko (Cate Blanchett), tienen el mismo objetivo.', './posters/83.jpg', 'Aventura', NULL, '127 minutos', 'Indiana Jones - y el Reino de la Calavera de Cristal, Harrison Ford, Shia LaBeouf, Cate Blanchett, Karen Allen, Ray Winstone, John Hurt, Jim Broadbent, Igor Jijikine, Dimitri Diatchenko, Kingdom of the crystal skull, Crystal Skull, kingdom', 'https://www.youtube.com/embed/WAdJf4wTC5Y', 2);
VALUES (84, 'Los Goonies', 'Mikey, un muchacho de trece años, que junto con su hermano mayor y sus amigos se hacen llamar ''Los Goonies'', decide subir a jugar al desván de su casa, donde su padre guarda antigüedades. Allí, el grupo encuentra el mapa de un tesoro y emprende un fabuloso viaje para validar la veracidad de dicho mapa, y encontrar ese tesoro tan preciado por estos amigos inseparables.', './posters/84.jpg', 'Familia', NULL, '114 minutos', 'Los Goonies, the goonies, The Goonies, los goonies, Familia, Aventura, Acción, Sean Astin, Josh Brolin, Jeff Cohen, Corey Feldman, Kerri Green, Martha Plimpton, Jonathan Ke Quan, Jogn matuszak, Robert Davi', 'https://www.youtube.com/embed/hJ2j4oWdQtU', 2);
VALUES (85, 'Cars', 'El aspirante a campeón de carreras Rayo McQueen está sobre la vía rápida al éxito, la fama y todo lo que él había soñado, hasta que por error toma un desvío inesperado en la polvorienta y solitaria Ruta 66. Su actitud arrogante se desvanece cuando llega a una pequeña comunidad olvidada que le enseña las cosas importantes de la vida que había olvidado.', './posters/85.jpg', 'Familia', NULL, '114 minutos', 'Cars, Familia, Animación, Aventura, Comedia, Owen Wilson, Bonnie Hunt, Paul Newman, Larry the Cable Guy, Tony Shalhoub, Cheech Marin, Michael Wallis, George Carlin, Paul Dooley', 'https://www.youtube.com/embed/SbXIj2T-_uk', 2);
VALUES (86, 'Los pingüinos de Madagascar', 'Los pingüinos llevan sus misiones en su hábitat en el Parque Central. Aparecen Julien, el rey de los lémures, y sus súbditos Maurice y Mort, sus nuevos vecinos, que constituyen la exhibición de lémures en el zoológico. Ahora los pingüinos deben mantener las cosas bajo control, a menudo a pesar de las payasadas de los lémures así como auxiliar en labores poco comunes o aventuras fuera de lo común. Skipper rara vez llama al Rey Julien por su nombre, dirigiéndose a él siempre como ''Cola anillada'' (por ser un lemur de cola anillada).', './posters/86.jpg', 'Familia', NULL, '101 minutos', 'Los pingüinos de Madagascar, pinguinos, pingüinos de madagascar, Penguins, Madagascar, Familia, Animación, Aventura, Comedia, John DiMaggio, Chris Miller, Tom McGrath Danny Jacobs, Andy Richter, Nicole Sullivan Christopher Knights, Wayne Knight', 'https://www.youtube.com/embed/SbXIj2T-_uk', 2);
VALUES (87, 'Cementerio de animales', 'Louis Creed, su esposa y sus dos niños se instalan en una vivienda próxima a una carretera con mucho tráfico. Cerca de la casa hay un sendero que lleva a un cementerio de animales y también a un antiguo cementerio indio; según la leyenda, los que sean enterrados allí volverán a la vida. Cuando uno de los niños muere atropellado por un camión, Louis ldecide enterrarlo en el cementerio indio.', './posters/87.jpg', 'Terror', NULL, '103 minutos', 'Cementerio de animales, Pet Sematary, Pet Cemetery, cementerio de animales, pet sematary, cemetery, Dale Midkiff, Terror, Drama, Suspenso, Fred Gwynne, Denise Crosby, Brad Greenquist, Michael Lombard, Miko Hughes, Blaze Berdahl, Susan Blommaert, Mara Clark', 'https://www.youtube.com/embed/JMao8sg4DPA', 2);
VALUES (88, 'Poltergeist', 'Una familia americana de clase media se traslada a vivir e una nueva casa en un aparentemente idílico barrio, pero dentro de la casa comienzan a suceder cosas extrañas, fenómenos paranormales para los que no hay explicación posible.', './posters/88.jpg', 'Terror', NULL, '114 minutos', 'Poltergeist, Fenómenos extraños, fenómenos, fenomenos, Craig T. Nelson, JoBeth Williams, Beatrice Straight, Dominique Dunne, Oliver Robins, Heather O''Rourke, Michael McManus, Virginia Kiser, Martin Casella, Terror, Drama, Suspenso, ya están aquí, ya estan aqui, they are here, They are Here', 'https://www.youtube.com/embed/9eZgEKjYJqA', 2);
VALUES (89, 'El código Da Vinci', 'El catedrático y afamado simbologista Robert Langdon se ve obligado a acudir una noche al Museo del Louvre, cuando el asesinato de un restaurador deja tras de sí un misterioso rastro de símbolos y pistas. Con la ayuda de la criptógrafa de la policía Sophie Neveu y poniendo en juego su propia vida, Langdon descubre que la obra de Leonardo Da Vinci esconde una serie de misterios que apuntan a una sociedad secreta encargada de custodiar un antiguo secreto que ha permanecido oculto durante dos mil años.', './posters/89.jpg', 'Aventura', NULL, '249 minutos', 'El código Da Vinci, davinci code, DaVinci Code, Aventura, Drama, Suspenso, Misterio, Tom Hanks, Audrey Tautou, Ian McKellen, Jean Reno, Paul Bettany, Alfred Molina, Jürgen Prochnow, Jean-Yves Berteloot, Etienne Chicot, Profesor Langdon, professor langdon, Robert Langdon, Louvre, Sophie Neveu, Leonardo Da Vinci', 'https://www.youtube.com/embed/lfqHb6INj3w', 2);
VALUES (90, 'Johnny English', 'Las joyas de la Corona de su Majestad han desaparecido. Detrás de ello se esconde Pascal Sauvage (John Malkovich), que también conspira para hacerse con el trono de la reina. La misión es asignada a Johnny English (Rowan Atkinson), un agente tan entregado al trabajo como inexperto. Desde ese momento la información confidencial, los coches de lujo y la tecnología más sofisticada forman parte de su rutina diaria. Johnny English aún no se lo acaba de creer. Quizás todo esto le venga algo grande, pero su empeño con la misión y dedicación para llegar hasta el final es incuestionable, especialmente después de conocer a la agente doble Lorna Campbell (Natalie Imbruglia). Parece ser que lo de estar enamorado aún hará más emocionante esto de salvar al país.', './posters/90.jpg', 'Comedia', NULL, '188 minutos', 'Johnny English, Comedia, Familia, Acción, Rowan Atkinson, Natalie Imbruglia, Ben Miller, John Malkovich, Greg Wise, Tasha de Vasconcelos, Douglas McFerran, Steve Nicolson, Terence Harvey', 'https://www.youtube.com/embed/EG0MR5dFz7E', 2);
VALUES (91, 'Almost Famous', 'Homenaje al rock de los 70. Gracias a sus buenas críticas musicales, un adolescente que aspira a ser periodista es contratado por la revista ''Rolling Stone'' para cubrir la gira de una famosa banda. A pesar de su juventud y de la oposición de su madre, el chico vivirá con los músicos y sus fans una aventura inolvidable. Basada en la propia experiencia de Crowe.', './posters/91.jpg', 'Drama', NULL, '122 minutos', 'Drama, Música, Suceso Real, Almost Famous, Casi Famosos, Billy Crudup, Frances McDormand, Kate Hudson, Patrick Fugit, Jason Lee, Zoey Deschanel, Michael Angarano, Anna Paquin, Fairuzza Balk, Rolling Stone', 'https://www.youtube.com/embed/aQXh_AaJXaM', 2);
VALUES (92, 'Escuela de Rock', 'Dewey Finn -Jack Black- es un guitarrista con delirios de grandeza que es expulsado de su banda. Desesperado por encontrar un trabajo ante su falta de dinero, suplanta la identidad de un profesor sustituto para dar clase en una escuela privada a los pequeños alumnos pre-adolescentes de 5o grado a los que intentará enseñarles el ''rock & roll de alto voltaje''. Además entre sus alumnos está Yuki, un guitarrista prodigio de 9 años que puede ayudar a Dewey a ganar la competición de bandas de música... y de paso solucionar sus problemas económicos.', './posters/92.jpg', 'Comedia', NULL, '110 minutos', 'Jack Black, Joan Cusack, Mike White, Sarah Silverman, Lee Wilkof, Kate McGregor-Stewart, Adam Pascal, Suzzane Douglas, Miranda Cosgrove, Escuela de Rock, escuela de rock, School of Rock, school of rock, Comedia, Música, Familia, Dewey Finn', 'https://www.youtube.com/embed/TExoc0MG4I4', 2);
VALUES (93, 'Mi pobre angelito', 'Kevin McAllister es un niño de ocho años, miembro de una familia numerosa, que accidentalmente se queda abandonado en su casa cuando toda la familia se marcha a pasar las vacaciones a Francia. Kevin aprende a valerse por sí mismo e incluso a protegerse de Harry y Marv, dos bribones que se proponen asaltar todas las casas cerradas de su vecindario. Cuando su madre Kate lo hecha en falta, realiza un pintoresco viaje de vuelta contra reloj a Chicago para recuperar a su hijo.', './posters/93.jpg', 'Familia', NULL, '102 minutos', 'Familia, Comedia, Música, Mi pobre angelito, home alone, Home Alone, Solo en casa, Kevin McAllister, Macaulay Culkin, Joe Pesci, Daniel Stern, John Heard, Catherine O''Hara, Roberts Blossom, Devin Ratray, Michael C. Maronna, Hillary Wolf', 'https://www.youtube.com/embed/jEDaVHmw7r4', 2);
VALUES (94, 'Aprendices fuera de línea', 'Cuando dos cuarentones vendedores de relojes son despedidos de sus respectivos trabajos, convencidos ambos de que no se han adaptado a los cambios de las nuevas tecnologías, deciden empezar de nuevo y buscar trabajo en la empresa más exitosa de Internet: Google. Finalmente consiguen un contrato de prácticas como becarios. La locura comienza cuando se ven compitiendo para conseguir el puesto con jóvenes veinteañeros, mucho más listos y más familiarizados con el mundo digital que ellos.', './posters/94.jpg', 'Comedia', NULL, '125 minutos', 'Aprendices fuera de línea, aprendices fuera de línea, los becarios, Los Becarios, The internships, Internships, Familia, Comedia, Owen Wilson, Vince Vaughn, Will Ferrell, Rose Byrne, Aasif Mandvi, Max Minghella, Josh Brener, Dylan O''Brien, Tiya Sircar, Tobit Raphael, Josh Gad, Jessica Szohr, Rob Riggle, Eric André, Harvey Guillén, Gary Anthony Williams, Bruno Amato, B.J. Novak, Karen Ceesay, John Goodman', 'https://www.youtube.com/embed/tn02SPT6ivM', 2);
VALUES (95, 'Outsourced', 'Ambientada en el continente estadounidense, una empresa norteamericana que busca reducir los gastos, asciende a su mejor empleado del Call Center, poniéndolo a cargo del mismo. La única condición para dicho empleado, es viajar a la India, lugar en el mundo donde tercerizan el servicio ode atención al cliente, para abaratar costos. Allí, en la Ciudad de Bombay, los nativos le explican la cultura indú a los nóveles norteamericanos, y viceversa. Tendrán que convivir cada uno de los empleados de estos diferentes países, con sus pares y/o jefes opuestos en cultura.', './posters/95.jpg', 'Comedia', 1, 'N/A', 'Outsourced, Tercerizado, Tercerizados, tercerizados, outsourced, outsource, tercerizado, Comedia, Familia, Rebecca Hazlewood, Sacha Dhawan, Diedrich Bader, Pippa Black, Parvesh Ceena, Thushari Jayasekera, Ben Rappaport, Guru Singh, Rizwan Manji, Anisha Nagarajan, Carla Gallo, Radhika Chaudhari, Nicholas Logan', 'https://www.youtube.com/embed/_wR3LhFlgGo', 1);
VALUES (96, 'Miedo Profundo', 'Nancy, una estudiante de medicina apasionada del surfing, es una joven que trata de superar la pérdida de su madre. Un día, practicando surf en una solitaria playa mexicana se queda atrapada en un islote a sólo cien metros de la costa. El problema está en que un enorme tiburón blanco se interpone entre ella y la otra orilla.', './posters/96.jpg', 'Suspenso', NULL, '86 minutos', 'Miedo Profundo, miedo profundo, the shallows, The Shallows, Suspenso, Drama, Infierno Azul, infierno azul, Terror, Blake Lively, Óscar Jaenada, Janelle Bailley, Chelsea Moody, Angelo Josue Lozano Corzo, José Manuel Trujillo Salas, Brett Cullen, Sedona Legge, Pablo Calva', 'https://www.youtube.com/embed/EgdxIlSuB70', 2);
VALUES (97, 'Everest', 'Inspirada en los hechos que tuvieron lugar durante un intento por alcanzar el pico más alto del mundo, narra las peripecias de dos expediciones que se enfrentan a la peor tormenta de nieve conocida. En un desesperado esfuerzo por sobrevivir, el temple de los alpinistas se ve puesto a prueba al tener que enfrentarse a la furia desatada de los elementos y a obstáculos casi insuperables.', './posters/97.jpg', 'Suceso Real', NULL, '121 minutos', 'Everest, everest, monte everest, Monte Everest, Suceso Real, Suspenso, Drama, Jason Clarke, Josh Brolin, Jake Gyllenhaal, Jogn Hawkes, Sam Worthington, Emily Watson, Martin Henderson, Michael Kelly, Keira Knightley, Robin Wright, Thomas M. Wright, Clive StandenNaoko Mori, Mia Goth, Elizabeth Debicki, Tom Goodman-Hill, Vanessa Kirby', 'https://www.youtube.com/embed/5ZQVpPiOji0', 2);
VALUES (98, 'La Familia Addams', 'El delirante y gótico estilo de vida de la peculiar familia Addams se ve amenazado peligrosamente cuando el codicioso dúo que forman madre e hijo, con la ayuda de un abogado sin ningún escrúpulos, conspiran para hacerse con la fortuna familiar... (No se pierdan las locutras de Gomez, Morticia, Tío Lucas, Merlina, El tío Cosas, Dedos y Largo)', './posters/98.jpg', 'Familia', NULL, '101 minutos', 'La Familia Addams, la familia addams, adams, Los locos Addams, Los locos Adams, The Addams Family, the addams family, Familia, Comedia, Fantasía, ', 'https://www.youtube.com/embed/G388UMkJIBE', 2);



